import { useNavigate } from "react-router-dom";
import UploadFile from "./UploadFile";
import FileList from "./FileList";
import fetchFiles  from "./FileList"; // Adjust the import path as necessary

import { useEffect, useState } from "react";
// import { set } from "mongoose";


function Dashboard() {
  const navigate = useNavigate();

  

  // const [myFile,setFile] = useState(0);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/");
  };

  // useEffect(() => {
  //   setFile(fetchFiles());
  // }, [myFile]);

  return (
    <div>
      <h2>Welcome to your Dashboard</h2>
      <button onClick={handleLogout}>Logout</button>
      <UploadFile />
      <FileList />
      <div>
        <h3>Your Files</h3>
        {/* This section can be expanded to list files uploaded by the user */}
        <p>File listing functionality will be implemented here.</p>
        </div>

         <div>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>My Files Dashboard</Typography>
          <Button color="inherit" onClick={handleLogout}>Logout</Button>
        </Toolbar>
      </AppBar>

      <Container sx={{ marginTop: 4 }}>
        <Grid container spacing={2}>
          <Grid item xs={12} md={4}>
            <UploadFile />
          </Grid>
          <Grid item xs={12} md={8}>
            <FileList />
          </Grid>
        </Grid>
      </Container>
    </div>
    </div>
  );
}

export default Dashboard;
